// tslint:disable-next-line:max-line-length
import { Component, OnInit, Input, ViewChild } from '@angular/core';
import { DomSanitizer } from '@angular/platform-browser';
import { ActivatedRoute } from '@angular/router';
import { CommentAgent } from 'app/common/entity/comment-agent';
import { CommetsService } from 'app/common/service/comment-list.service';
import { Page } from 'app/core/entity/page';
import { Comment } from 'app/common/entity/comment';
import { FormBuilder, FormGroup, Validators } from '@angular/forms';
import { CookieService } from 'ngx-cookie-service';
import { cp } from '@angular/core/src/render3';
import { ReplyFormComponent } from '../../reply-form/reply-form.component';



@Component({
    selector: 'qy-comment-list',
    templateUrl: './comment-list.component.html',
    styleUrls: ['./comment-list.component.scss']
})
export class CommentListComponent implements OnInit {

    @Input() target: CommentAgent;
    validateForm: FormGroup;
    comment: Comment = new Comment();
    // tslint:disable-next-line:max-line-length
    dangerousVideoUrl = "data:image/png;base64,";
    // tslint:disable-next-line:max-line-length
    // dangerousVideoUrl  = "data:image/svg+xml;base64,";
    imagSrc;
    page = 1;
    show: Boolean[] = new  Array<Boolean>(false);
    replyShow: Boolean[] = new  Array<Boolean>(false);
    textFiltering: string = "暂无";
    commentData: Page<Comment>;
    searchList: any;
    pageIndex = 1;
    loading = false;
    thumbnail;
    isShow: false;
    isReplyShow: Boolean[] = new  Array<Boolean>(false);
    // @ViewChild(ReplyFormComponent)
    // childd: ReplyFormComponent;
    // showFalg: false;
    constructor(private sanitizer: DomSanitizer,
        private fb: FormBuilder,
        private cookieService: CookieService,
        activeRouter: ActivatedRoute,
        private commetsService: CommetsService) {
        // this.articleId = activeRouter.snapshot.paramMap.get('articleId');
    }

    ngOnInit() {
        let obj = this.comment || new Comment();
        this.imagSrc = this.sanitizer.bypassSecurityTrustUrl(this.dangerousVideoUrl);
        this.validateForm = this.fb.group({
            author: [ obj.author, [ Validators.required ]],
            email: [obj.email, [ Validators.required, Validators.email ]],
            url: [ obj.url],
            content: [obj.content, [ Validators.required ]]
        });
        if (this.target && this.target.commentCount > 0 ) {
            this.loadData();
        }
    }

    getNewUrl(urlStrng) {
        if (!urlStrng) {
          return this.imagSrc;
        }
       return this.sanitizer.bypassSecurityTrustUrl(urlStrng);
   }



    loadData() {
        if ( this.commentData) {
            this.commentData.number = this.pageIndex ? this.pageIndex - 1  : this.commentData.number;
        }
        let params = {
            ...this.searchList,
            agentTargetId: this.target.id,
            page: this.commentData ? this.commentData.number  : 0,
            size: this.commentData ? this.commentData.size : 3,
            // sort: page && page.sort ? page.sort : null
        };
        this.commentData = new Page<Comment>();
        this.commetsService.findAll(params).subscribe(
            data => {
                console.log("findAll", data);
              this.loading = false;
              this.commentData = data;
            this.getCookieComemntAuthor();
            },
            error => {
              console.log(error);
              this.loading = false;
            }
          );
    }
    replyShowFun(i) {
        this.replyShow[i] = true;
        let that = this;
        // this.isReplyShow[i] = true;
        this.replyShow.forEach((element, index ) => {
            if (i !== index) {
                that.replyShow[index] = false;
            }
            that.isReplyShow[index] = true;
        });
    }

    submitForm(event) {
        this.commetsService.created(event.value).subscribe(
            data => {
                console.log("保存成功：data", data);
                this.loadData();
            },
            error => {
                console.log("保存失败：data", error);
            }
        );
    }
    childReply(event) {
        let that = this;
        this.replyShow.forEach((element, index ) => {
                that.replyShow[index] = false;
                that.isReplyShow[index] = false;
        });
    }
    submitReplyForm(event) {
        this.commetsService.createdReply(event.value).subscribe(
            data => {
                console.log("保存成功：data", data);
                this.loadData();
            },
            error => {
                console.log("保存失败：data", error);
            }
        );
    }
    clearnReplyForm(event, i) {
        this.replyShow[i] = false;
    }

    getCookieComemntAuthor() {
        console.log("getCookieComemntAuthor this.cookieService getAll", this.cookieService.getAll());
        console.log("getCookieComemntAuthor this.cookieService ", this.cookieService);
        // tslint:disable-next-line:max-line-length
        console.log("getCookieComemntAuthor this.cookieService.get(comment_remember_author)", this.cookieService.get("comment_remember_author"));
        this.comment.author = this.cookieService.get("comment_remember_author");
        if (this.comment.author) {
            this.comment.email =  this.cookieService.get("comment_remember_mail");
            this.comment.url =   this.cookieService.get("comment_remember_url");
            console.log("getCookieComemntAuthor this.comment", this.comment);
            // this.childd.getCookieChildComemntAuthor();
        }
        console.log("getCookieComemntAuthor this.comment2", this.comment);
    }
}
